class Graph:
    def __init__(self):
        self.graph = {}

    def add_node(self, value):
        node = Node(value)
        self.graph[value] = node
        return node

    def get_node(self, value):
        return self.graph[value]

    def add_edge(self, from_node, to_node, weight=0):
        from_node.neighbors.append((to_node, weight))

class Node:
    def __init__(self, value):
        self.value = value
        self.neighbors = []
        self.distance = float("inf")
        self.previous = None

def dijkstra(graph, start):
    start.distance = 0
    nodes = list(graph.values())

    while nodes:
        closest = None
        for node in nodes:
            if closest is None or node.distance < closest.distance:
                closest = node

        if closest is start:
            return closest

        nodes.remove(closest)

        for neighbor, weight in closest.neighbors:
            if neighbor.distance > closest.distance + weight:
                neighbor.previous = closest
                neighbor.distance = closest.distance + weight

    return None

