Your task is to write a function in C# that sorts this array based on the severity of the symptoms. 

Here are some rules about how to sort the records:
1. The severity of the symptom is defined as the number of characters in the name of the symptom. 
2. If two or more symptoms have the same severity, sort them alphabetically. 
3. All the symptoms of a patient must be considered before sorting that patient's record.

Question: Write a function `sortPatientRecords` that sorts this array based on the rules given above. The output should be an array of records sorted according to these criteria.


This problem can be solved using the following steps:
 Define a function called 'compareSymptoms' to sort the symptoms first by their severity (number of characters) and then alphabetically if two or more have the same severity. This step involves using a custom sorting algorithm like Merge Sort which is not straightforward in C# but can be used here as it sorts based on multiple conditions.
 Create a function called 'sortPatientRecords' that takes an array of patient records as input and returns the sorted list of patients, where each patient record is represented by an object with Name, Age, and Symptoms fields. In this step, you'll also need to use the 'compareSymptoms' function defined in the previous step to sort the symptoms first.
 Use a sorting algorithm such as Quick Sort or Heap Sort which can handle multiple conditions simultaneously to sort the entire patient records based on their name and age fields after the symptoms have been sorted. This is because the symptom severity will determine the order of the patients, so we don't need to sort them again.
 Finally, return the sorted list of patients.


Here's how this could be implemented in C#:
```csharp
using System;
class PatientRecord {
    public string Name { get; set; }
    public int Age { get; set; }
    public List<string> Symptoms { get; set; }
}
public static void sortPatientRecords(List<PatientRecord> records) {
    compareSymptoms(records, 0, records.Count - 1);
}
private static void compareSymptoms(List<PatientRecord> records, int startIndex, int endIndex) {
    if (startIndex >= endIndex)
        return;

    int pivot = partition(records, startIndex, endIndex);
    compareSymptoms(records, startIndex, pivot - 1);
    compareSymptoms(records, pivot + 1, endIndex);
}
private static int partition(List<PatientRecord> records, int startIndex, int endIndex) {
    PatientRecord pivot = records[startIndex];
    int i = (startIndex + 1);
    for (int j = startIndex + 1; j <= endIndex; j++) {
        if (compareSymptoms(records, i, j)) {
            records[i - 1] = records[i];
            i++;
        }
    }
    records[startIndex] = records[i - 1];
    records[i - 1] = pivot;
    return i - 1;
}
static void compareSymptoms(List<PatientRecord> records, int i, int j) {
    if (records[i].Sympthoms.Count < records[j].Sympthoms.Count || records[i].Sympthoms.Count == records[j].Sympthoms.Count && records[i].Name.Length > records[j].Name.Length)
        return -1;
    else if (records[i].Sympthoms.Count < records[j].Sympthoms.Count || records[i].Sympthoms.Count == records[j].Sympthoms.Count && records[i].Name.Length <= records[j].Name.Length)
        return 1;
    else {
        return 0;
    }
}
public static List<PatientRecord> sortPatientRecords(List<PatientRecord> records) {
    int n = records.Count;
    sortPatientRecords(records);
    return records;
}
